import React, { Component } from 'react'
import {StyleSheet, View, Text, Image , TouchableHighlight, TextInput } from 'react-native'
import { Icons } from "../constants/Image";


class Register extends Component {
	constructor(props) {
		super(props);
		this.state = {  }
	}
	render() {
		return (
			<View style={styles.Register}>
				<View style={styles.LogoContainer}>
					<Image style={styles.Logo} source={Icons.Logo}/>
				</View>
				<View style={styles.FormTitle}>
					<Text>LOG IN</Text>
				</View>
				<View style={styles.TextInputContainer}>
					<TextInput style={styles.Input} placeholder="Email"/>
					<TextInput style={styles.Input} placeholder="Password"/>
				</View>
				<TouchableHighlight style={styles.TextInputButton}>
					<Text>Log In</Text>
				</TouchableHighlight>
			</View>
		)
	}
}

const styles = StyleSheet.create({
	Register: {
        width: "100%",
        height: "100%",
		backgroundColor: "white",

		display: "flex",
		justifyContent: "flex-start",
		alignItems: "center"
	},
	LogoContainer: {
		width: "100%",
		height: "40%",
		paddingBottom: 10,

		display: "flex",
		justifyContent: "flex-end",
		alignItems: "center"

	},
	Logo: {
		width: 160,
		height: 160,

    },
    FormTitle: {
        marginTop: 20,
        marginBottom: 20

    },
	TextInputContainer: {
        width: "100%",

        display: "flex",
        justifyContent: "center",
        alignItems: "center"

    },
    Input: {
        width: "90%",
        height: 50,
        paddingLeft: 10,
        marginBottom: 15,
        backgroundColor: "red",
        borderRadius: 5,
        borderWidth: 0.5,
    },
	TextDetailsBox: {
		width: "100%",
        padding: 10,

		display: "flex",
		justifyContent: "center",
		alignItems: "center"
	},
	DetailsText: {
		textAlign: "center", 
		fontSize: 18, 
		color : "black"
	},
	ButtonContainer: {
		width: "100%",
		height: 200,
		// backgroundColor: "yellow",

		display: "flex",
		justifyContent: "flex-start",
		alignItems: "center"
	},
	Button: {
		width: 200,
		height: 50,
		borderRadius: 10,
		borderWidth: 1,
		borderColor: "#5e4942",
		marginTop: 10,
		marginBottom: 10,
		// backgroundColor: "#b2897b",

		display: "flex",
		justifyContent: "center",
		alignItems: "center"
	},
	ButtonText: {
		textTransform: "uppercase",
		color: "#5e4942"
	}
})

export default Register
